import React from "react";
import Link from "next/link";

function Nav() {
	return (
		<nav>
			<Link href="/">products </Link>
			<Link href="/">sell </Link>
			<Link href="/">orders </Link>
			<Link href="/">account </Link>
			<Link href="/">cart </Link>
		</nav>
	);
}

export default Nav;
